import React, { useEffect } from 'react';
import styled from 'styled-components';
import { useHistory } from 'react-router-dom';
import Container from '../components/Container';
import Aos from 'aos';
import 'aos/dist/aos.css';

const logoURL = '/images/start_logo.png';

const Start: React.FC = () => {
    const history = useHistory();
    useEffect(() => {
        Aos.init({ duration: 1500, anchorPlacement: 'top-center' });
    },[]);

    const pushMain = () => {
        history.push('/main');
    }

    return (
        <Container>
            <LogoBox>
                <Logo data-aos='fade-in' URL={logoURL} />
                <div style={{ fontSize: '40px', textAlign: 'center' }} > ∨ </div>
            </LogoBox>
            <TextContainer>
                <Text data-aoi='fade-up' > 가나다라마바사아 </Text>
            </TextContainer>
        </Container>
    )
}

export default Start

const LogoBox = styled.div`
    width: 900px;
    height: 1000px;
`;

const Logo = styled.div<{ URL: string }>`
    width: 900px;
    height: 900px;
    background-image: url(${({ URL }) => URL});
    background-size: cover;
    background-position: center;
`;

const TextContainer = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    align-items: center;
    width: 100%;
    height: 3000px;
`;

const Text = styled.div`
    font-size: 50px;
    color: ${({ theme }) => theme.colors.black};
`;

const Btn = styled.button`
    all: unset;
    width: 200px;
    height: 70px;
    border-radius: 40px;
    background-color: ${({ theme }) => theme.colors.mainBlue};
    color: ${({ theme }) => theme.colors.white};
    font-size: 30px;
    text-align: center;
    cursor: pointer;
`;
